/**
 *
 * Utility function to get env variables.
 *
 * @param name env variable name
 * @param defaultVaue default value to return if the env variable is not set
 * @returns string
 *
 * @internal
 */
declare const getEnvVariable: (name: string, defaultVaue?: string) => string;
declare const getPublicEnvVariables: () => {
    publishableKey: string;
    domain: string;
    isSatellite: boolean;
    proxyUrl: string;
    pk: string;
    signInUrl: string;
    signUpUrl: string;
    clerkJsUrl: string;
    clerkJsVariant: "" | "headless" | undefined;
    clerkJsVersion: string;
    telemetryDisabled: boolean;
    telemetryDebug: boolean;
    afterSignInUrl: string;
    afterSignUpUrl: string;
};

export { getEnvVariable, getPublicEnvVariables };
